import React, { useEffect, useState } from "react";

const Dashboard = () => {
  const [data, setData] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      // Simulando fetch
      const result = await Promise.resolve("Datos cargados");
      setData(result);
    };
    fetchData();
  }, []);

  return (
    <div>
      <h1>Dashboard</h1>
      <p>{data ? data : "Cargando..."}</p>
    </div>
  );
};

export default Dashboard;
